function show_all_rows(table) {
    if ($("#check_show_all").is(':checked')) {
        table.rows().every(function (rowIdx, tableLoop, rowLoop) {
            var header = this.data();
            var detail = this.data().GET_SUB_DETAIL_CASE;
            $.each(detail, function (index, value) {
                $('table.table_reason_detail >  tbody.' + header.ID_CASE_DET + ' > tr.' + value.ID_CASE_SD).show();               
            });
        });
    }
    else {
        table.rows().every(function (rowIdx, tableLoop, rowLoop) {
            var header = this.data();
            var detail = this.data().GET_SUB_DETAIL_CASE
            $.each(detail, function (index, value) {
                if (value.ALLOW_MODIFY == "0") {
                    $('table.table_reason_detail >  tbody.' + header.ID_CASE_DET + ' > tr.' + value.ID_CASE_SD).hide();
                }
            });
        });
    }
}

function expired_solve_before(solve_before_pass) {
    if(solve_before_pass == "0"){
        $(".solve_before_pass").hide();
    } else {
        $(".solve_before_pass").show();
    }
}

function get_new_le_detail(id_case_sd, id_new_qty, lp, id_case_d, original_le_h, original_qty_h, original_qty_d, new_le_d, usage_qty, max_percentage_mix, id_textbox_new_qty) {
    
    var new_qty_d = $('#' + id_new_qty).val();

    save_data_detail_row_table(id_new_qty, new_qty_d, id_case_d, id_case_sd,"");

    //PENDINETE condicinar si el checkbox expandir esta check no ejecute el expand all
    if ($("#check_expand_all").prop('checked')==false) {
        //alert('ok')
        expand_all_rows(table); ///exapande todo cada que tecleo
    }


    var t_new_le_d = parseFloat(((new_qty_d / usage_qty) * max_percentage_mix));
    $('#lblnewle' + id_case_sd).text(t_new_le_d.toFixed(2));

    var new_le_t_d = $('#lblnewle' + id_case_sd).text();

    /*sumatoria de new qty**********************/
    var new_qty_total = 0;
    $('table.table_reason_detail >  tbody.' + id_case_d).find('tr').each(function (idx, row) {
        var new_qty_t = $("td:eq(9) input:text", row).val();
        if(new_qty_t !== ""){
            new_qty_total += parseInt(new_qty_t);
        }
    });
    $('#lblnewqtyheader' + id_case_d).text(new_qty_total);

    /*sumatoria de new le********************/
    var new_le_total = 0;
    $('table.table_reason_detail >  tbody.' + id_case_d).find('tr').each(function (idx, row) {
        var new_le_t = $("td:eq(6) label", row).text();
        //console.log(new_le_t);
        if (new_le_t !== "") {
            new_le_total += parseFloat(new_le_t);
        }
    });
    $('#lblnewleheader' + id_case_d).text(new_le_total.toFixed(2));
    /****************************************************************************************/

    /*sumarizado de los po en diferentes envios*/
    var new_qty_to_reduce_total = 0;
    $('table.table_reason_detail').find('tr').each(function (idx, row) {
        var new_qty_po_reduce = $('td:eq(9) input.' + id_textbox_new_qty, row).val();
        if (new_qty_po_reduce !== "" && new_qty_po_reduce !== undefined) {
            new_qty_to_reduce_total += parseInt(new_qty_po_reduce);
        }       
    });
    $('.lblnewqtypo_summary_total' + id_textbox_new_qty).text(new_qty_to_reduce_total);
    var avaliable = $('.lblavailablepo_summary_total' + id_textbox_new_qty).text();
    $('.lbl_reduced_summary_total' + id_textbox_new_qty).text(avaliable - new_qty_to_reduce_total);
   
    

    validate_qty_detail(original_qty_d, new_qty_d, id_new_qty);
    validate_le_header(id_case_d, new_le_total);
    save_data_detail_row_table(id_new_qty, new_qty_d, id_case_d, id_case_sd, new_le_t_d);


    /** ***********10/08/2019****************/
    //PENDIENTE condicinar si el checkbox expandir esta check no ejecute el expand all
    if ($("#check_expand_all").prop('checked')==false) {
        //alert('ok')
        collapsed_all_rows(table);
        closeOpenedRows(table);
        set_focus_txtbox_detail_new_qty(id_new_qty);
    }
    /** **************************/

}

function validate_qty_detail(original_qty_d, new_qty, id_new_qty) {
    //alert("new: " + new_qty + " original: " + original_qty_d + " id_textbox: " + id_new_qty);
    if (parseInt(new_qty) > parseInt(original_qty_d)) {
        $('#' + id_new_qty).css('background-color', 'red');
        $('#' + id_new_qty).css('color', 'white');
    } else {
        $('#' + id_new_qty).css('background-color', 'white');
        $('#' + id_new_qty).css('color', 'black');
    }
}

function validate_le_header(id_case_d, new_le_total) {
    if (new_le_total >= load_eff_min) {
        $('.row' + id_case_d).css('background-color', '#8fd19e');
    } else {
        $('.row' + id_case_d).css('background-color', '#ffdf7e')
    }
}

function save_data_detail_row_table(id_new_qty, new_qty_d, id_case_d, id_case_sd, new_le_t_d) {
    $('.save').data(id_new_qty, {
        'id_new_qty': id_new_qty,
        'new_qty_d': new_qty_d,
        'id_case_d': id_case_d,
        'id_case_sd': id_case_sd,
        'new_le_t_d': new_le_t_d
    });
}

function get_data_detail_row_table() {
    var data = $('.save').data();
    if (JSON.stringify(data) !== "{}") {
        $.each(data, function (index, items) {
            $('#' + items.id_new_qty).val(items.new_qty_d);
            $('#lblnewle' + items.id_case_sd).text(items.new_le_t_d);
        });
    }
}

