function closeOpenedRows(table){
    $.each(openRows, function (index, openRow){
        var child = table.row( openRow ).child;
        child.show();
    });
}

function collapsed_all_rows(table){
    $(".even").removeClass('shown');
    $(".odd").removeClass('shown');
    table.rows().every(function (rowIdx, tableLoop, rowLoop) {
        if (this.child.isShown()) {
            this.child.hide();
        }
    });
}

function set_focus_txtbox_detail_new_qty(id_new_qty){
    $('#' + id_new_qty).focus();
}

